import React, { PureComponent } from "react";
import { ScatterChart, Scatter, XAxis, YAxis, CartesianGrid, Tooltip } from "recharts";

import { Player, RankedPlayer } from "../../../types";

import dataAll from "../../../../data/data-all.json";

// const data = [
//   { x: 100, y: 200, z: 200 },
//   { x: 120, y: 100, z: 260 },
//   { x: 170, y: 300, z: 400 },
//   { x: 140, y: 250, z: 280 },
//   { x: 150, y: 400, z: 500 },
//   { x: 110, y: 280, z: 200 },
// ];

const data = dataAll.perRoundData.map((item: RankedPlayer, index: number) => ({
  x: item.points,
  y: index + 1,
}));

export default class Example extends PureComponent {
  render() {
    return (
      <ScatterChart
        width={900}
        height={900}
        margin={{
          top: 20,
          right: 20,
          bottom: 20,
          left: 20,
        }}
      >
        <CartesianGrid />
        <XAxis type="number" dataKey="x" name="points" unit="point" />
        <YAxis type="number" dataKey="y" name="rounds" unit="round" />
        <Tooltip cursor={{ strokeDasharray: "3 3" }} />
        <Scatter name="Points per round" data={data} fill="#8884d8" />
      </ScatterChart>
    );
  }
}
